import React, { useState, useRef } from 'react';
import { motion, AnimatePresence } from 'framer-motion';

interface MovementLabProps {
  brainwaveMode: string;
}

interface MovementPost {
  id: string;
  title: string;
  description: string;
  author: string;
  timestamp: string;
  movementType: 'flow' | 'rhythm' | 'stillness' | 'expression' | 'synchronization';
  collectiveImpact: number;
  imageUrl: string;
  videoUrl?: string;
  likes: number;
  shares: number;
  isLive?: boolean;
}

const mockMovementPosts: MovementPost[] = [
  {
    id: '1',
    title: 'Morning Flow Sequence',
    description: 'A gentle morning movement sequence that awakens the body and mind. Perfect for transitioning from sleep to conscious awareness.',
    author: 'Sarah Chen',
    timestamp: '2 hours ago',
    movementType: 'flow',
    collectiveImpact: 89,
    imageUrl: 'https://images.unsplash.com/photo-1506905925346-21bda4d32df4?w=400&h=600&fit=crop',
    likes: 234,
    shares: 45
  },
  {
    id: '2',
    title: 'Rhythmic Drum Circle',
    description: 'Collective rhythm creation through synchronized drumming. Experience the power of unified movement and sound.',
    author: 'Marcus Rodriguez',
    timestamp: '4 hours ago',
    movementType: 'rhythm',
    collectiveImpact: 92,
    imageUrl: 'https://images.unsplash.com/photo-1516280440614-37939bbacd81?w=400&h=500&fit=crop',
    likes: 567,
    shares: 123,
    isLive: true
  },
  {
    id: '3',
    title: 'Meditative Stillness',
    description: 'Finding peace through complete stillness. A practice of conscious non-movement that reveals inner wisdom.',
    author: 'Zen Master Li',
    timestamp: '6 hours ago',
    movementType: 'stillness',
    collectiveImpact: 78,
    imageUrl: 'https://images.unsplash.com/photo-1506905925346-21bda4d32df4?w=400&h=700&fit=crop',
    likes: 189,
    shares: 67
  },
  {
    id: '4',
    title: 'Expression Through Dance',
    description: 'Free-form dance as a medium for emotional expression and release. Let your body tell its story.',
    author: 'Aisha Thompson',
    timestamp: '8 hours ago',
    movementType: 'expression',
    collectiveImpact: 85,
    imageUrl: 'https://images.unsplash.com/photo-1516280440614-37939bbacd81?w=400&h=550&fit=crop',
    likes: 342,
    shares: 89
  },
  {
    id: '5',
    title: 'Global Synchronization',
    description: 'Thousands of people moving in harmony across time zones. The power of collective consciousness in motion.',
    author: 'Global Movement Collective',
    timestamp: '12 hours ago',
    movementType: 'synchronization',
    collectiveImpact: 96,
    imageUrl: 'https://images.unsplash.com/photo-1506905925346-21bda4d32df4?w=400&h=650&fit=crop',
    likes: 1247,
    shares: 234
  },
  {
    id: '6',
    title: 'Breath-Led Movement',
    description: 'Movement guided by the rhythm of breath. Each motion flows naturally from inhalation and exhalation.',
    author: 'Breath Master Kai',
    timestamp: '1 day ago',
    movementType: 'flow',
    collectiveImpact: 91,
    imageUrl: 'https://images.unsplash.com/photo-1516280440614-37939bbacd81?w=400&h=600&fit=crop',
    likes: 456,
    shares: 112
  },
  {
    id: '7',
    title: 'Shadow Work Through Movement',
    description: 'Using movement to explore and integrate shadow aspects of consciousness. Transform darkness into light.',
    author: 'Shadow Alchemist',
    timestamp: '1 day ago',
    movementType: 'expression',
    collectiveImpact: 83,
    imageUrl: 'https://images.unsplash.com/photo-1506905925346-21bda4d32df4?w=400&h=580&fit=crop',
    likes: 298,
    shares: 76
  },
  {
    id: '8',
    title: 'Quantum Movement Patterns',
    description: 'Exploring the quantum nature of movement and consciousness. How our movements affect the field.',
    author: 'Quantum Movement Lab',
    timestamp: '2 days ago',
    movementType: 'synchronization',
    collectiveImpact: 94,
    imageUrl: 'https://images.unsplash.com/photo-1516280440614-37939bbacd81?w=400&h=720&fit=crop',
    likes: 789,
    shares: 156
  }
];

const movementTypeColors = {
  flow: '#00ffff',
  rhythm: '#ff00ff',
  stillness: '#ffff00',
  expression: '#00ff00',
  synchronization: '#ff0080'
};

const movementTypeIcons = {
  flow: '🌊',
  rhythm: '🥁',
  stillness: '🧘',
  expression: '💃',
  synchronization: '🌐'
};

export const MovementLab: React.FC<MovementLabProps> = ({ brainwaveMode }) => {
  const [posts, setPosts] = useState<MovementPost[]>(mockMovementPosts);
  const [selectedType, setSelectedType] = useState<string>('all');
  const [isRecording, setIsRecording] = useState(false);
  const canvasRef = useRef<HTMLCanvasElement>(null);

  const getAnimationSpeed = () => {
    switch (brainwaveMode) {
      case 'delta': return 0.8;
      case 'theta': return 1.2;
      case 'alpha': return 1;
      case 'beta': return 1.5;
      case 'gamma': return 2;
      default: return 1;
    }
  };

  const filteredPosts = selectedType === 'all' 
    ? posts 
    : posts.filter(post => post.movementType === selectedType);

  const handleMouseMove = (e: React.MouseEvent) => {
    if (!canvasRef.current) return;

    const canvas = canvasRef.current;
    const rect = canvas.getBoundingClientRect();
    const x = e.clientX - rect.left;
    const y = e.clientY - rect.top;

    const ctx = canvas.getContext('2d');
    if (!ctx) return;

    // Clear canvas
    ctx.clearRect(0, 0, canvas.width, canvas.height);

    // Draw movement trail with neon effect
    ctx.beginPath();
    ctx.arc(x, y, 3, 0, 2 * Math.PI);
    ctx.fillStyle = 'rgba(255, 0, 255, 0.8)';
    ctx.fill();

    // Add glow effect
    ctx.shadowColor = '#ff00ff';
    ctx.shadowBlur = 10;
    ctx.beginPath();
    ctx.arc(x, y, 1, 0, 2 * Math.PI);
    ctx.fillStyle = 'rgba(255, 255, 255, 1)';
    ctx.fill();
    ctx.shadowBlur = 0;
  };

  return (
    <div className="w-full h-full bg-black text-white p-6">
      {/* Header with High-Frequency Neon Effects */}
      <div className="glass-dark rounded-2xl p-6 mb-8 neon-fog-overlay">
        <motion.h1 
          className="text-4xl font-bold mb-2"
          animate={{ 
            scale: [1, 1.02, 1],
            filter: [
              'hue-rotate(0deg) brightness(1.2) saturate(1.5)',
              'hue-rotate(180deg) brightness(1.6) saturate(2.0)',
              'hue-rotate(360deg) brightness(1.2) saturate(1.5)'
            ]
          }}
          transition={{ 
            duration: 3,
            repeat: Infinity,
            ease: "easeInOut"
          }}
        >
          Movement Lab
        </motion.h1>
        <motion.p 
          className="text-gray-400 mb-4 electric-pulse-text"
          animate={{ 
            textShadow: [
              '0 0 5px #ff00ff, 0 0 10px #ff00ff, 0 0 15px #ff00ff',
              '0 0 5px #00ffff, 0 0 10px #00ffff, 0 0 15px #00ffff',
              '0 0 5px #ffff00, 0 0 10px #ffff00, 0 0 15px #ffff00',
              '0 0 5px #00ff00, 0 0 10px #00ff00, 0 0 15px #00ff00',
              '0 0 5px #ff00ff, 0 0 10px #ff00ff, 0 0 15px #ff00ff'
            ]
          }}
          transition={{ 
            duration: 2,
            repeat: Infinity,
            ease: "easeInOut"
          }}
        >
          Express consciousness through movement
        </motion.p>

        {/* Movement Type Filter with Neon Effects */}
        <div className="flex flex-wrap gap-3">
          {['all', 'flow', 'rhythm', 'stillness', 'expression', 'synchronization'].map((type) => (
            <motion.button
              key={type}
              className={`px-4 py-2 rounded-full text-sm font-medium transition-all ${
                selectedType === type 
                  ? 'glass-medium text-black' 
                  : 'glass-light text-white hover:glass-medium'
              }`}
              style={{
                textShadow: selectedType === type 
                  ? '0 0 10px rgba(255, 255, 255, 0.8), 0 0 20px rgba(255, 255, 255, 0.6)'
                  : 'none'
              }}
              onClick={() => setSelectedType(type)}
              whileHover={{ 
                scale: 1.05,
                filter: 'brightness(1.2) saturate(1.5)'
              }}
              whileTap={{ scale: 0.95 }}
            >
              {type === 'all' ? 'All Movements' : 
               `${movementTypeIcons[type as keyof typeof movementTypeIcons]} ${type.charAt(0).toUpperCase() + type.slice(1)}`}
            </motion.button>
          ))}
        </div>
      </div>

      {/* Live Recording Section with Neon Effects */}
      <div className="glass-dark rounded-2xl p-6 mb-8 neon-fog-overlay">
        <div className="grid grid-cols-1 lg:grid-cols-3 gap-6">
          {/* Movement Canvas */}
          <div className="lg:col-span-2">
            <motion.div
              className="relative rounded-xl overflow-hidden"
              style={{
                background: 'rgba(255, 255, 255, 0.05)',
                backdropFilter: 'blur(10px)',
                border: '1px solid rgba(255, 255, 255, 0.1)',
                boxShadow: '0 0 20px rgba(255, 0, 255, 0.3)'
              }}
              animate={{
                boxShadow: [
                  '0 0 20px rgba(255, 0, 255, 0.3)',
                  '0 0 30px rgba(0, 255, 255, 0.4)',
                  '0 0 20px rgba(255, 255, 0, 0.3)',
                  '0 0 30px rgba(0, 255, 0, 0.4)',
                  '0 0 20px rgba(255, 0, 255, 0.3)'
                ]
              }}
              transition={{
                duration: 4,
                repeat: Infinity,
                ease: "easeInOut"
              }}
            >
              <canvas
                ref={canvasRef}
                className="w-full h-64 lg:h-80"
                onMouseMove={handleMouseMove}
              />

              {/* Recording Overlay with Neon Effects */}
              <div className="absolute top-4 right-4 flex space-x-2">
                <motion.button
                  className={`px-4 py-2 rounded-full text-sm font-medium ${
                    isRecording 
                      ? 'bg-red-500/80 backdrop-blur-sm text-white' 
                      : 'glass-button text-white'
                  }`}
                  style={{
                    textShadow: isRecording 
                      ? '0 0 10px rgba(255, 0, 0, 0.8), 0 0 20px rgba(255, 0, 0, 0.6)'
                      : 'none'
                  }}
                  onClick={() => setIsRecording(!isRecording)}
                  whileHover={{ 
                    scale: 1.05,
                    filter: 'brightness(1.2) saturate(1.5)'
                  }}
                  whileTap={{ scale: 0.95 }}
                >
                  {isRecording ? '⏹️ Stop' : '🔴 Record'}
                </motion.button>

                {isRecording && (
                  <motion.div
                    className="px-3 py-1 rounded-full bg-red-500/20 backdrop-blur-sm text-red-300 text-xs"
                    animate={{ 
                      opacity: [0.5, 1, 0.5],
                      scale: [1, 1.1, 1],
                      textShadow: [
                        '0 0 5px rgba(255, 0, 0, 0.8)',
                        '0 0 10px rgba(255, 0, 0, 1)',
                        '0 0 5px rgba(255, 0, 0, 0.8)'
                      ]
                    }}
                    transition={{ duration: 1, repeat: Infinity }}
                  >
                    LIVE
                  </motion.div>
                )}
              </div>
            </motion.div>
          </div>

          {/* Collective Stats with Neon Effects */}
          <div className="space-y-4">
            <div className="glass-card rounded-xl p-4">
              <h3 className="text-lg font-semibold mb-2 neon-cyan">Collective Activity</h3>
              <div className="space-y-3">
                <div className="flex justify-between items-center">
                  <span className="text-sm text-gray-400">Active Movements</span>
                  <span className="text-white font-semibold neon-green">1,247</span>
                </div>
                <div className="w-full bg-gray-700 rounded-full h-2">
                  <motion.div
                    className="h-2 rounded-full"
                    style={{
                      background: 'linear-gradient(90deg, #ff00ff, #00ffff, #ffff00, #00ff00)',
                      backgroundSize: '200% 100%'
                    }}
                    initial={{ width: 0 }}
                    animate={{ 
                      width: '87%',
                      backgroundPosition: ['0% 0%', '100% 0%', '0% 0%']
                    }}
                    transition={{ 
                      width: { duration: 1 },
                      backgroundPosition: { duration: 2, repeat: Infinity, ease: "linear" }
                    }}
                  />
                </div>
              </div>
            </div>

            <div className="glass-card rounded-xl p-4">
              <h3 className="text-lg font-semibold mb-2 neon-yellow">Movement Types</h3>
              <div className="space-y-2">
                {Object.entries(movementTypeIcons).map(([type, icon]) => (
                  <div key={type} className="flex items-center justify-between">
                    <span className="text-sm">{icon} {type}</span>
                    <span className="text-xs text-gray-400">
                      {posts.filter(p => p.movementType === type).length}
                    </span>
                  </div>
                ))}
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* Pinterest-style Movement Grid with Neon Effects */}
      <div className="masonry-grid">
        <AnimatePresence>
          {filteredPosts.map((post, index) => (
            <motion.div
              key={post.id}
              className="masonry-item"
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              exit={{ opacity: 0, y: -20 }}
              transition={{ 
                duration: 0.5,
                delay: index * 0.1
              }}
            >
              <div className="pinterest-card hover-lift">
                {/* Image */}
                <img
                  src={post.imageUrl}
                  alt={post.title}
                  className="pinterest-card-image"
                />

                {/* Live Badge with Neon Effect */}
                {post.isLive && (
                  <motion.div
                    className="absolute top-4 left-4 px-3 py-1 rounded-full bg-red-500/80 backdrop-blur-sm text-white text-xs font-medium"
                    animate={{ 
                      opacity: [0.7, 1, 0.7],
                      scale: [1, 1.1, 1],
                      textShadow: [
                        '0 0 5px rgba(255, 0, 0, 0.8)',
                        '0 0 10px rgba(255, 0, 0, 1)',
                        '0 0 5px rgba(255, 0, 0, 0.8)'
                      ]
                    }}
                    transition={{ duration: 1.5, repeat: Infinity }}
                  >
                    🔴 LIVE
                  </motion.div>
                )}

                {/* Movement Type Badge with Neon Effect */}
                <div 
                  className="absolute top-4 right-4 px-3 py-1 rounded-full backdrop-blur-sm text-white text-xs font-medium"
                  style={{ 
                    backgroundColor: `${movementTypeColors[post.movementType]}20`,
                    border: `1px solid ${movementTypeColors[post.movementType]}40`,
                    textShadow: `0 0 5px ${movementTypeColors[post.movementType]}, 0 0 10px ${movementTypeColors[post.movementType]}`
                  }}
                >
                  {movementTypeIcons[post.movementType]} {post.movementType}
                </div>

                {/* Hover Overlay */}
                <div className="pinterest-card-overlay">
                  <div className="space-y-3">
                    <div>
                      <h3 className="text-lg font-semibold text-white mb-1 neon-shimmer-text" data-text={post.title}>
                        {post.title}
                      </h3>
                      <p className="text-sm text-gray-200 line-clamp-2">
                        {post.description}
                      </p>
                    </div>

                    <div className="flex items-center justify-between">
                      <div className="flex items-center space-x-2">
                        <div className="w-6 h-6 rounded-full bg-gradient-to-r from-purple-500 to-pink-500" />
                        <span className="text-xs text-gray-300">{post.author}</span>
                      </div>
                      <span className="text-xs text-gray-400">{post.timestamp}</span>
                    </div>

                    <div className="flex items-center justify-between">
                      <div className="flex items-center space-x-4 text-xs">
                        <span className="text-gray-300">❤️ {post.likes}</span>
                        <span className="text-gray-300">📤 {post.shares}</span>
                      </div>
                      <div className="flex items-center space-x-1">
                        <span className="text-xs text-gray-400">Impact:</span>
                        <span 
                          className="text-xs font-semibold"
                          style={{ 
                            color: movementTypeColors[post.movementType],
                            textShadow: `0 0 5px ${movementTypeColors[post.movementType]}, 0 0 10px ${movementTypeColors[post.movementType]}`
                          }}
                        >
                          {post.collectiveImpact}%
                        </span>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </motion.div>
          ))}
        </AnimatePresence>
      </div>
    </div>
  );
};
